        <figure class=""stand_out"">

            <h3 class=""medium_heading""> II. OBJECTIFS PEDAGOGIQUES </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine du programme </h3>
                <p class=""description""> 
                    Le génie civil représente l'ensemble des techniques de constructions civiles. Les ingénieurs civils ou ingénieurs en génie civil s’occupent de la
                    conception, la réalisation, l’exploitation et la réhabilitation d’ouvrages de construction et d’infrastructures dont ils assurent la gestion afin de
                    répondre aux besoins de la société, tout en assurant la sécurité du public et la protection de l’environnement. Notre programme de Licence en
                    Génie Civil – Bâtiments et Travaux Public (GC – BTP) a été conçu pour permettre à l");
            WriteLiteral(@"’étudiant de devenir un technicien bien outillé et qui sait
                    prendre en compte les questions environnementales dans tous les projets qu’il serait amené à initier ou à être associé.
                </p>
            </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Objectifs du programme </h3>
                <h3 class=""smaller_heading""> II.2.1. Objectif général </h3>
                <p class=""description""> 
                    La licence Génie Civil mention Bâtiments et Travaux Publics (GC-BTP) a pour objectif l’acquisition de connaissances fondamentales et
                    appliquées dans le domaine du Génie Civil. Elle prépare les étudiant-e-s à une poursuite d’études en Master Génie Civil ou en Ecoles
                    d’Ingénieurs y compris dans les mines et carrières.
                    Les deux premières années sont généralistes en Sciences pour l’Ingénieur, la spécialisation en Génie Civil mention Bâtiments et Travaux P");
            WriteLiteral(@"ublics
                    s’opérant dès l’entrée en 3ème année.
                    Le premier semestre est pluridisciplinaire et commun aux licences mention Physique-Chimie (PC) et Electronique, Energie Electrique,
                    Automatique, afin que l’étudiant-e affine progressivement son choix. La licence GC mention Bâtiments et Travaux Publics s’inscrit par ailleurs
                    Dossier cycle Licence Business Intelligence Institute of Management-B2IM-Institut d’Etudes en Management-IEM
                    2 	
                    dans un portail commun L1-L2 (semestres 1 à 4) entre les mentions EEEA et GC. Les compétences transversales et pré-professionnelles
                    acquises durant les trois années de Licence permettent à l’étudiant-e qui ne souhaiterait pas effectuer une poursuite d’études de postuler à des
                    emplois de technicien ou d’assistant dans divers corps de métiers, ou de se présenter à des concours de la fonction publique.        
           ");
            WriteLiteral(@"     </p>

                <h3 class=""smaller_heading""> II.2.2. Objectifs spécifiques </h3>
                <p class=""description""> 
                    <strong> Commun à la mention </strong><br/>
                    Ce programme permet à l’étudiant de : <br/>
                </p>
                <ul class=""one_list"">
                    <li> Savoir résoudre des problèmes simples de génie civil en utilisant les concepts de résistance des matériaux, mécanique des solides, calculs de structures, mécanique des fluides, thermique... </li>
                    <li> Utiliser les bases du Dessin Assisté par Ordinateur (DAO) et de la Conception Assistée par Ordinateur (CAO) et celles du calcul scientifique (logiciels métiers) afin de modéliser des structures simples en 2D et de les dimensionner sous sollicitations simples. </li>
                    <li> Connaître et savoir utiliser les normes et règlementations en vigueur. </li>
                    <li> Utiliser en autonomie des techniques expérimentales co");
            WriteLiteral(@"urantes dans le domaine du génie civil, valider un modèle par comparaison de ses prévisions aux résultats expérimentaux et apprécier ses limites de validité. </li>
                    <li> Identifier les différentes étapes et les acteurs d’une construction. </li>
                    <li> Identifier les principales familles de matériaux et leurs caractéristiques. </li>
                </ul>

                <h3 class=""small_heading""> II.3. Approche du programme </h3>
                <p class=""description""> 
                    Le programme prépare au parcours licence en génie civil préparant aux métiers ou à une formation d’ingénieur en infrastructures et
                    aménagement ou ouvrages et construction.
