            <h3 class=""medium_heading""> V. DEBOUCHES PROFESSIONNELS	</h3>
                <p class=""description""> 
                    Les secteurs d’activités visés sont : les entreprises du BTP, les bureaux d’études techniques en Génie Civil, Environnement, Thermique, etc., les
                    cabinets de maîtrise d’œuvre ou les services de maîtrise d’ouvrages, les bureaux de contrôle technique, les laboratoires d’essais, etc. <br/>");
            WriteLiteral(@"
                    Les emplois pour lesquels les titulaires du diplôme de pourront postuler sont notamment : 	
                </p>
                <ul class=""one_list"">
                    <li> Chef d’entreprise ou Adjoint au chef d’entreprise de BTP, </li>
                    <li> Consultant junior, </li>
                    <li> Chargé d’étude, etc. </li>
                </ul>
        </figure>

