        <figure class=""stand_out"">
            <h3 class=""medium_heading""> VI. CONTROLE DES CONNAISSANCES </h3>
                <ul class=""one_list"">
                    <li> Un contrôle continu pour chaque cours magistral </li>
                    <li> Une session d’examen (oral ou écrit) à la fin de chaque semestre organisée en fonction des matières inscrites au semestre </li>
                    <li> Rédaction d’un rapport de stage soutenu devant un jury en fin de cycle. </li>
                </ul>
        </figu");
            WriteLiteral(@"re>

        <!-- end seventh stand out -->


    <!-- begin seventh stand out -->
    
        <figure class=""stand_out"">
            <h3 class=""medium_heading""> VII. PROCEDURE D’EVALUATION </h3>
                <p class=""description""> 
                    Chaque unité d'enseignement fait l’objet d’une évaluation au sein de commissions d'évaluation tripartites associant les étudiants, les enseignants
                    et la direction de l’enseignement. Les commissions d'évaluation sont placées sous la double responsabilité du directeur académique et du service
                    en charge de l’évaluation. Le processus d’évaluation requiert pour chaque unité d’enseignement une participation active des étudiants,
                    directement par réponse à un questionnaire et par la voie de représentants. La synthèse des informations recueillies par la commission
                    d'évaluation contribue à déterminer les adaptations à apporter à l’unité d’enseignement considéré et à faire é");
            WriteLiteral(@"voluer l'offre d'enseignement.
                </p>
        </figure>

